,p_process_name=>'PR_PARSE_UPLOAD'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
'  l_file_name   VARCHAR2(512);',
'  l_mime_type   VARCHAR2(255);',
'  l_size_bytes  NUMBER;',
'BEGIN',
'  SELECT filename,',
'         mime_type,',
'         DBMS_LOB.getlength(blob_content)',
'    INTO l_file_name,',
'         l_mime_type,',
'         l_size_bytes',
'    FROM apex_application_temp_files',
'   WHERE name = :P10_FILE;',
'',
'  :P10_BATCH_ID := pkg_weekly_sales_upload.create_batch(',
'                     p_file_name        => l_file_name,',
'                     p_mime_type        => l_mime_type,',
'                     p_content_size     => l_size_bytes,',
'                     p_uploaded_by      => :APP_USER,',
'                     p_template_version => :P10_TEMPLATE_VERSION',
'                   );',
'',
'  pkg_weekly_sales_upload.parse_upload(',
'    p_batch_id       => :P10_BATCH_ID,',
'    p_temp_file_name => :P10_FILE',
'  );',
'',
'  apex_application.g_print_success_message :=',
'    ''File parsed successfully. Review preview rows.'';',
'EXCEPTION',
'  WHEN NO_DATA_FOUND THEN',
'    raise_application_error(-20001, ''Uploaded file not found in APEX temp storage.'');',
'  WHEN OTHERS THEN',
'    raise_application_error(-20002, ''Parse failed: '' || SQLERRM);',
'END;'))
