'  l_status poc_weekly_sales_batch.status%TYPE;',
'BEGIN',
'  pkg_weekly_sales_upload.process_batch(',
'    p_batch_id => :P13_BATCH_ID,',
'    p_processed_by => :APP_USER',
'  );',
'',
'  SELECT status',
'    INTO l_status',
'    FROM poc_weekly_sales_batch',
'   WHERE batch_id = :P13_BATCH_ID;',
'',
'  IF l_status = ''PROCESSED_WITH_ERRORS'' THEN',
'    apex_application.g_print_success_message :=',
'      ''Processed with errors. Some rows were rejected.'';',
'  ELSE',
'    apex_application.g_print_success_message :=',
'      ''Batch processed successfully.'';',
'  END IF;',
'EXCEPTION',
'  WHEN OTHERS THEN',
'    raise_application_error(-20031, ''Process failed: '' || SQLERRM);',
'END;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(12749327881454620)
